import PcWindow from '../pcWindow/pcWindow';
import Phone from '../phone/phone';
import Gear from '../gear/gear';
import Cloud from '../cloud/cloud';
import PhoneLeft from '../phoneLeft/phoneLeft';
import PhoneRight from '../phoneRight/phoneRight';
import Landing from '../landing/landing';
import Depth from '../depth/depth';
import LetsTalk from '../letsTalk/letsTalk';


const ServicePage = (): JSX.Element => {

    const elements: JSX.Element = <div className="servicePage__messagePhone"><Landing /></div>;

    return (
        <div className="servicePage">
            <div className="servicePage__cloud">
                <div><span>Cloud Services</span></div>
                {/* <div className="servicePage__cloud__pcWindow">
                    <PcWindow elements={elements} />
                </div>
                <div className="servicePage__cloud__phone">
                    <Phone />
                </div>
                <div className="servicePage__cloud__gear">
                    <Gear />
                </div>
                <div className="servicePage__cloud__cloud">
                    <Cloud />
                </div> */}
                <div className="servicePage__cloud__wrapperPhoneLeft">
                    <PhoneLeft classNameAdded="phoneLeft--purple" elements={elements} />
                </div>
                <div className="servicePage__cloud__wrapperPhoneLeft">
                    <PhoneLeft classNameAdded="phoneLeft--purple" elements={elements} />
                </div>

                <div className="servicePage__cloud__wrapperPhoneRight">
                    <PhoneRight elements={elements} />
                </div>
            </div>
        </div >
    );
}

export default ServicePage;
